         "The different legal bases that we use are:" : "[中国的~The different legal bases that we use are:]",
         "Necessary for the performance of a contract with you:" : "[中国的~Necessary for the performance of a contract with you:]",
         "We rely on this legal basis when we need to process certain personal information, such as your contact details, payment details, and shipment details, to perform our obligations or to manage our contractual relationship (see above) with you." : "[中国的~We rely on this legal basis when we need to process certain personal information, such as your contact details, payment details, and shipment details, to perform our obligations or to manage our contractual relationship (see above) with you.]",
         "Examples:" : "[中国的~Examples:]",
