         "    We capture your use of, and interaction with our websites (see above) to improve them." : "[中国的~    We capture your use of, and interaction with our websites (see above) to improve them.]",
         "    We process your IBMid (see Your Account (above) ) to manage access authorization of our services." : "[中国的~    We process your IBMid (see Your Account (above) ) to manage access authorization of our services.]",
         "    Where we have a contractual relationship (see above) with the organization that you are working for, we have a legitimate interest to process your personal information used to manage this contract." : "[中国的~    Where we have a contractual relationship (see above) with the organization that you are working for, we have a legitimate interest to process your personal information used to manage this contract.]",
         "    We process your business contact information (see Your Account (above)) in combination with other business-relevant information to tailor our interactions with you and promote our products and services. We may process your contact information together with details of an IBM event you attended to develop Marketing (see above) and business intelligence." : "[中国的~    We process your business contact information (see Your Account (above)) in combination with other business-relevant information to tailor our interactions with you and promote our products and services. We may process your contact information together with details of an IBM event you attended to develop Marketing (see above) and business intelligence.]",
         "    We process the personal information of applicants based on our legitimate interest to source suitable talent (see Recruitment and Former Employees (above))." : "[中国的~    We process the personal information of applicants based on our legitimate interest to source suitable talent (see Recruitment and Former Employees (above)).]",
         "    We have to keep our general business operations (see above) functional. To this end we may, for example, processes the log in information of our IT systems and networks, or CCTV footage at IBM locations (see above) for security and safety purposes." : "[中国的~    We have to keep our general business operations (see above) functional. To this end we may, for example, processes the log in information of our IT systems and networks, or CCTV footage at IBM locations (see above) for security and safety purposes.]",
         "We may also process personal information where it is necessary to defend our rights in judicial, administrative, or arbitral proceedings. This also falls under the legal basis of legitimate interest in countries where they are not a separate legal basis." : "[中国的~We may also process personal information where it is necessary to defend our rights in judicial, administrative, or arbitral proceedings. This also falls under the legal basis of legitimate interest in countries where they are not a separate legal basis.]",
         "We process personal information for credit protection, which is a specific legal basis under Brazilian law (LGPD) but is also covered under the legal basis of legitimate interest in other countries." : "[中国的~We process personal information for credit protection, which is a specific legal basis under Brazilian law (LGPD) but is also covered under the legal basis of legitimate interest in other countries.]",
